import React from "react";
import HomeLayouts from "../Layouts/HomeLayouts";
import Banner from "../sections/Banner";
import Contacts from "../sections/Contacts";
import About from "../sections/About";

const index = () => (
  <React.Fragment>
    <HomeLayouts>
      <Banner />
      <Contacts />
      <About />
      <Services />
    </HomeLayouts>
  </React.Fragment>
);

export default index;
